import get from 'lodash/get';
import has from 'lodash/has';
import throttle from 'lodash/throttle';
import clone from 'lodash/clone';
import deepClone from 'lodash/cloneDeep';

export default {
  clone,
  deepClone,
  get,
  has,
  throttle
}
